import React, {Component} from 'react';
import {connect} from 'react-redux';
import {getDOWRequest, getDOWSuccess} from '../actions/dow';
import {Alert} from 'reactstrap';
import axios from 'axios'
import { FormGroup, Form, Button, Label, Input } from 'reactstrap';
import {useState} from 'react'

axios.defaults.baseURL = 'https://www.quandl.com/api/v3/datasets'


class App extends Component {
    constructor(props){
        super(props);
    }

    handleSubmit = () => {
        this.props.getDOWRequest();
    };

    render(){
        const items = this.props.items;
        return (
            <div style={{margin: '0 auto', padding: '20px', maxWidth: '600px'}}>
                <Button onClick = {this.handleSubmit}> Get DOW Quotes </Button>
            </div>
        );
    }
}

export default connect(({items}) => ({items}), {
    getDOWRequest,
})(App);
